		Name: 'Franciszek Piechowski',
		image: assets.franciszekPiechowski,
		description:
			'Urodził się 11 grudnia 1915 w Kościerzynie na Pomorzu Gdańskim. Był synem Franciszka (1886–1976), od 1923 drogomistrza w Starostwie Powiatowym w Starogardzie i Pelagii Brygidy z Krapkowskich (1890–1971). Miał siostrę Agnieszkę (zamężną Orłowską, 1918–2002) i braci: Feliksa (1913–1986, prezesa Sądu Powiatowego i adwokata w Starogardzie) i Jana (1921–1999), absolwenta WSE w Krakowie, harcmistrza, komendanta hufców ZHP w Krakowie i Myślenicach oraz dyrektora Oddziału Centralnej Składnicy Harcerskiej. Szkołę powszechną ukończył w 1928 w Bobowie k. Starogardu, gdzie wówczas mieszkała jego rodzina. Edukację kontynuował w Szkole Rzemieślniczo-Przemysłowej w Tczewie – w 1934 ukończył oddział mechaniczny, a w 1935 oddział elektryczny tej szkoły. Do ZHP wstąpił w I Drużynie Harcerzy im. Tadeusza Kościuszki w Starogardzie, gdzie w latach 1929–1931 był zastępowym. W okresie nauki w Tczewie był przybocznym 67 Pomorskiej Żeglarskiej Drużyny Harcerzy – brał z nią udział w 1932 w Międzynarodowym Zlocie Skautów Wodnych w Garczynie. W tym samym roku założył w Bobowie 90 Pomorską Drużynę Harcerzy, której drużynowym był do 1935. Zdobył harcerski stopień HR i uczestniczył w III Narodowym Zlocie ZHP w Spale (1935).  W latach 1935–1937 odbył służbę wojskową, w czasie której ukończył szkołę podoficerską w 143 eskadrze dywizjonu myśliwskiego w Toruniu. Do wybuchu II wojny światowej pracował w Warsztatach Kolejowych w Bydgoszczy i był w tym mieście przybocznym 7 Drużyny Harcerzy im. Karola Chodkiewicza – Wielkopolska Chorągiew Harcerzy.  W czasie okupacji do 1943 pracował w niemieckich firmach budowlanych w Starogardzie i Kijowie; w tym okresie dwukrotnie uczestniczył w przerzucie broni dla AK w Krakowie. W latach 1944–1945 pod zmienionym nazwiskiem ukrywał się w Krakowie i Czernej. Po wyzwoleniu powrócił do Starogardu i wraz z żoną do 1949 prowadził sklep tekstylny. Powrócił również do działalności harcerskiej.  W lutym 1946 powołany został na funkcję komendanta Hufca Harcerzy w Starogardzie Gdańskim – pełnił ją do maja 1948. W tym czasie otwarto w mieście wyremontowany Dom Harcerza (1947) a z okazji 750-lecia Starogardu zorganizowano zlot harcerski (czerwiec 1948) połączony z pracami społecznymi. W lutym 1948 uzyskał stopień podharcmistrza. W latach 1949–1952 pracował zawodowo w starogardzkich Zakładach Koksowniczych jako kierownik działu technicznego, a od 1952 do emerytury w 1979 w Zakładach Ogniw i Baterii „Centra” jako główny mechanik.  Po odrodzeniu harcerstwa powrócił do czynnej działalności w ZHP i w styczniu 1958 ponownie powierzono mu funkcję komendanta Hufca Harcerstwa w Starogardzie Gdańskim – sprawował ją do października 1972. Za jego kadencji hufiec otrzymał sztandar (1958), wybudował stanicę harcerską w Parku Miejskim (1959–1961), pozyskał w Cieciorce obiekt na kolonię zuchową, zainicjował budowę odsłoniętego w 1967 Pomnika Poległych i Zamordowanych Starogardzkich Harcerzy w latach 1939–1945 i obelisku w Zelgoszczy ku pamięci członków tajnej organizacji „Jaszczurka” (1981). W 1965 hufiec był gospodarzem Zjazdu Młodzieżowych Kręgów Instruktorskich ZHP, a w 1968 powołał drugą w chorągwi orkiestrę dętą. W 1972, ponad 6 tys. hufiec, otrzymał imię gen. Józefa Wybickiego, a sztandar hufca udekorowany został Krzyżem „Za Zasługi dla ZHP”.  Piechowski otrzymał stopień harcmistrza w 1959. Funkcję komendanta hufca łączył z działalnością w zespole chorągwianym (1959–1964), Chorągwianej Komisji Rewizyjnej (1960–1962) i Radzie Chorągwi (1964–1969) a po rezygnacji z funkcji hufcowego przez 20 lat był członkiem Komisji Rewizyjnej Chorągwi Gdańskiej ZHP (1974–1993) oraz kierował przez wiele lat powstałym w hufcu w 1981 roku Kręgiem Instruktorów Starszych im. Zygmunta Bączkowskiego. Honorowy stopień harcmistrza PL otrzymał w 1970. Aktywnie udzielał się też w Związku Zawodowym Metalowców i Towarzystwie Miłośników Ziemi Kociewskiej. W 1975 roku został wpisany do „Księgi Honorowej Zasłużonych dla Starogardu Gdańskiego”. Zmarł 12 czerwca 1998 w Starogardzie Gdańskim. Pochowany został z honorami w asyście harcerskiej z udziałem tczewskiej Harcerskiej Orkiestry Dętej, na nowym Cmentarzu katolickim. Był odznaczony Krzyżem Kawalerskim OOP (1975), Srebrnym Krzyżem Zasługi (1968), Krzyżem „Za Zasługi dla ZHP” (1966), Złotym Krzyżem „Za Zasługi dla ZHP” (1981), Odznaką Honorową „Zasłużonym Ziemi Gdańskiej” (1966), medalem „Za Zasługi dla Starogardu Gdańskiego” (1975), Honorową Odznaką „Zasłużony Instruktor Chorągwi Gdańskiej ZHP” (1995) i in. Na wniosek radnych w 2018 jedna z ulic Starogardu Gdańskiego otrzymała imię Franciszka Piechowskiego.  W 1945 zawarł zawiązek małżeński z Leokadią Makowską (1913–1991). Miał trzy córki: Ewę (zamężną Seelig, ur. 1945, inż. obuwnik, zam. RFN), Marię (zamężną Miotk, ur. 1949, nauczycielkę – dyr. szkoły, zam. w Starogardzie Gd.), Barbarę (zamężną Gliniecka, ur. 1950, technik ekonomista, zam. w Starogardzie) i syna Juliusza (ur. 1948, inż. budownictwa i nauczyciel, zam. w Starogardzie) – dzieci do ukończenia szkół średnich były członkami ZHP',
